data.value:
Select variant of using of style file:
• Click “Yes” if you want to apply style(s) to selected diagram element(s);
• Click “No” if you want to add new curve(s) with this style(s) to existing curve(s);
• Click “Cancel” if you don't need to apply styles

Enter formula for curve generation
Allowed:
 • numbers (with dots or commas);
 • signs: +, -, *, /, ^, (, );
 • functions: sin, cos, tg, ctg, arcsin, arccos, arctg, arcctg, ln, abs;
 • constants П (pi) and e;
 • variable name (x)

Usage from command line:

GeomagDataDrawer – for application launch;

GeomagDataDrawer /? – to show this message;

GeomagDataDrawer <filename> – loading of file «filename»;

GeomagDataDrawer <filename> <filename_2> [SLC] [ECC] – data files conversion, from first format to second;
  [SLC] – lines count for columns names search; will be loaded from configuration if not set;
  [ECC] – expected count of data columns (for extracting); will be loaded from configuration if not set
